No Sleep Till Miley!...Week Is Wide Awake.

2013-08-20, thewaymouth aka mikedreams is just sittin on the dock of The Pirate Bay. This maddest Miley fan is just gettin so turned up now. 

&quot;Hello, Miley, this is Mikey, Miley, mighty glad to have you back where you belong!&quot;

For Bangers, the brand new album from Miley Cyrus, is landing on our shores to shore us up to the heavens, but a heavensent seven weeks away from today.

But before we get to that, Miles will appear at the MTV VMAs in Brooklyn this Sunday. She is nominated for &quot;Best Female Video,&quot; &quot;Best Editing,&quot; &quot;Best Pop Video&quot; and &quot;Best Song of the Summer.&quot; 

Should be nominated for &quot;Video of the Year,&quot; since her latest single, &quot;We Can't Stop,&quot; is like only the most watched, has to be seen to be believed, music video of all time. But MTV has no balls. Whereas Miley has mirror balls and will be wearing them on her sleeve when she performs at the VMAs for her very first time ever. 

&quot;Breakout/ Let the party start!&quot; But first -- and oh yes I have a thirst for firsts -- shall we go back? It's the Teen Choice Awards -- yes, where Miley would go on to win Song of the Summer for 2013 -- but 'the time of our lives' is now 2009, and the world debut of &quot;Party in the U.S.A.&quot;

