2009-08-09: Miley presented Britney Spears that night with the Ultimate Choice Award.

Miley herself won the following awards...
Choice Music: Single - &quot;The Climb&quot;
Choice Movie Actress: Music/Dance - &quot;Hannah Montana: The Movie&quot;
Choice Movie: Hissy Fit - &quot;Hannah Montana: The Movie&quot;
Choice TV Actress: Comedy - &quot;Hannah Montana&quot;
Choice TV Show: Comedy - &quot;Hannah Montana&quot;
Choice Summer Song: &quot;Before the Storm&quot; [Jonas Brothers feat. Miley Cyrus]

Miley thus becomes first person ever to win Teen Choice awards in each of three categories in the same year: Music, Movies and TV. To celebrate this achievement, the Teen Choice Awards becomes the site of the night of the world debut of Miley's new single due out the next day, &quot;Party in the U.S.A.&quot; Miley was just sweet 16 at the time of her big coming out party in the U.S.A. Her latest single would become her biggest to date, reaching #2 on The Hot 100. 

