But then a funny thing happened: Miley went away. Miley's last single to be released in the USA came the following May, with 2010's &quot;Can't Be Tamed.&quot;

Hurry up and wait! Miley is back like she never left cause she never really did. She has just been getting ready all this time for her next final arrival. Now going on 21, Miley is riding high on 2013, with but her biggest single ever. 

And we're back for The Climb, too. Cause we never went away. We never stopped believing in her believing in us. Cause together we can't be stopped... 

Q. &quot;Who owns my heart?&quot; A. You scream, I scream, we all kick n scream for Miley's ice cream!

Haters gonna hate, and greats gonna get greater. From the #1 Teen Choice to All World Girl, everyone wants some Smiley. &quot;We gonna get it when we live it (walk)!&quot; 

So here now for miles of smiles all around, Miley is coming for you and with you, noddin her hot head n movin her hop hips, like &quot;yeah!&quot; 
&quot;Got my hands up, they're playin' my song/ And now I'm gonna be okay/ Yeah! It's a party in the USA!&quot;
&quot;Miley, don't ever go away again!&quot;
